// Helper function to get country by code
export const getCountryByCode = code => {
  return countries.find(country => country.code === code);
};

// Helper function to get country by name
export const getCountryByName = name => {
  return countries.find(country => country.name.toLowerCase() === name.toLowerCase());
};

// Helper function to search countries
export const searchCountries = query => {
  const lowercaseQuery = query.toLowerCase();
  return countries.filter(country => country.name.toLowerCase().includes(lowercaseQuery) || country.code.toLowerCase().includes(lowercaseQuery));
};
export default countries;
